import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const OlderOrder = () => {
  return (
    <div>
      <nav className="navbar fixed-top bg-body-tertiary">
        <div className="container-fluid">
          <span className="navbar-brand">ABC 카페 키오스크</span>
          <button
            type="button"
            className="btn btn-success call-staff"
            data-bs-toggle="modal"
            data-bs-target="#callStaff"
          >
            직원 호출
          </button>
        </div>
      </nav>

      <div
        className="modal fade"
        id="callStaff"
        tabIndex="-1"
        aria-labelledby="exampleModalLabel"
        aria-hidden="true"
      >
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h1 className="modal-title fs-5" id="exampleModalLabel">
                직원 호출
              </h1>
              <button
                type="button"
                className="btn-close"
                data-bs-dismiss="modal"
                aria-label="Close"
              ></button>
            </div>
            <div className="modal-body">
              키오스크 사용이 어려우신가요? 직원이 도와드리겠습니다!
            </div>
            <div className="modal-footer">
              <button
                type="button"
                className="btn btn-secondary"
                data-bs-dismiss="modal"
              >
                닫기
              </button>
              <button
                type="button"
                className="btn btn-primary"
                data-bs-dismiss="modal"
                data-bs-target="#calledStaff"
              >
                직원 호출
              </button>
            </div>
          </div>
        </div>
      </div>

      <nav className="navbar navbar-expand-lg">
        <div className="container-fluid">
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav flex-column" style={{position:'relative', top:'100px'}}>
                                <li className="nav-item">
                                    <button className="btn btn-primary nav-link" style={{ fontSize: '48pt' , width:'250px', height:'150px'}}>인기</button>
                                </li>
                                <li className="nav-item">
                                    <button className="btn btn-warning nav-link" style={{ fontSize: '48pt' , width:'250px', height:'150px'}}>음료</button>
                                </li>
                                <li className="nav-item">
                                    <button className="btn btn-success nav-link" style={{ fontSize: '48pt' , width:'250px', height:'150px'}}>디저트</button>
                                </li>
            </ul>
          </div>
        </div>
      </nav>

      <div className="accordion" id="accordionExample" style={{ position: 'absolute', left: '17%', top: '15%', width: '54%' }}>
        <div className="accordion-item">
          <h2 className="accordion-header" id="headingOne">
            <button
              className="accordion-button"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#collapseOne"
              aria-expanded="true"
              aria-controls="collapseOne"
              style={{ fontSize: 'xx-large' }}
